import { useEffect, useState } from "react";

function App() {
  const [data, setData] = useState();

  console.log(data);
  useEffect(() => {
    setData(
      fetch("./Rule JSON.json")
        .then((data) => data.json())
        .then((item) => item.data)
    );
  }, []);

  return (
    <div>
      <h1>{data}</h1>
    </div>
  );
}

export default App;
